import './App.css';
import SignIn from './Basic_Components/Login';
import Navbar from './Basic_Components/Navbar';

function App() {
  return (
    <div className="App">
     <h1>Basic Comp.</h1>
     <h2>{new Date().getFullYear()}</h2>
     <Navbar/>
     <SignIn/>
    </div>
  );
}

export default App;
